<!DOCTYPE html>

    <body>

                            </div>
                            <img class="vector" src="img/vector-6.svg" />
                        </div>
                        <div class="comprehensive">
                            <div class="normal-text-wrapper">

                            <img class="vector" src="img/vector-2.svg" />

                <div class="nav-item">
                    <img class="img" src="../img/BillingIcon.png" />

                </div>
                <div class="nav-item">
                    <img class="img" src="../img/Setting.png" />

                </div>
            </div>
            <div class="top-bar">
                <div class="information">
                    <div class="time"><div class="text">9:41</div></div>
                    <div class="icons">
                        <div class="frame-2">
                            <div class="overlap-group"><div class="rectangle"></div></div>
                            <img class="vector-2" src="img/vector-3.svg" />

                        <img class="vector-3" src="img/vector.svg" />
